const team = [
  {
    id: 1,
    name: 'John Baker',
    role: 'Head Chef',
    image: '/team/john.jpeg',
  },
  {
    id: 2,
    name: 'Mike Simpson',
    role: 'Pastry Chef',
    image: '/team/mike.jpeg',
  },
  {
    id: 3,
    name: 'Katelyn Smith',
    role: 'Decorating Specialist',
    image: '/team/sam.jpeg',
  },
];

export default team;
